import React, { Component } from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import IconButton from "@material-ui/core/IconButton";
import { Route, Redirect, Link } from "react-router-dom";
import MenuIcon from "@material-ui/icons/Menu";
import LandingPage from "../LandingPage/landingpage";
import p4 from "../../Icons/p4.webp";
import { Card } from "antd";
import "./footer.css";

class Navbar extends Component {
  constructor(props) {
    super(props);
  }
  state = {
    classes: makeStyles((theme) => ({
      root: {
        flexGrow: 1,
      },
      menuButton: {
        marginRight: theme.spacing(2),
      },
      title: {
        flexGrow: 1,
      },
    })),
    redirect: null,
  };

  render() {
    return (
      <div>
        {/* <div>Nav bar</div> */}
        {this.state.redirect}
        <AppBar position="static">
          <Toolbar style={{ backgroundColor: "#807e7e" }}>
            {/* <IconButton
              edge="start"
              className={this.state.classes.menuButton}
              color="inherit"
              aria-label="menu"
            >
              {/* <MenuIcon /> */}
            {/* </IconButton>  */}

            <Typography variant="h6" className={this.state.classes.title}>
              <Link
                style={{
                  color: "black",
                  fontWeight: "800",
                  fontFamily: "Georgia, serif",
                }}
                to="/landingpage"
              >
                PetGoHome
              </Link>
              <img
                src={p4}
                style={{
                  width: "45px",
                  height: "45px",
                  marginLeft: "7px",
                }}
              ></img>
            </Typography>
            <Typography style={{ marginLeft: "2%" }}>
              <Link
                style={{
                  color: "black",
                  fontWeight: "540",
                  fontFamily: "Georgia, serif",
                }}
                to="/landingpage"
              >
                Feed
              </Link>
            </Typography>
            <Typography style={{ marginLeft: "1%" }}>
              <Link
                style={{
                  color: "black",
                  fontWeight: "540",
                  fontFamily: "Georgia, serif",
                }}
                to="/home"
              >
                I Found Or Lost a Pet
              </Link>
            </Typography>
            <Typography style={{ marginLeft: "1%" }}>
              <Link
                style={{
                  color: "black",
                  fontWeight: "540",
                  fontFamily: "Georgia, serif",
                }}
                to="/whomtocontact"
              >
                Contact
              </Link>
            </Typography>
            <Typography style={{ marginLeft: "1%" }}>
              <Link
                style={{
                  color: "black",
                  fontWeight: "540",
                  fontFamily: "Georgia, serif",
                }}
                to="/stolenpets"
              >
                Stolen Pets
              </Link>
            </Typography>

            <Typography style={{ marginLeft: "1%" }}>
              <Link
                style={{
                  color: "black",
                  fontWeight: "540",
                  fontFamily: "Georgia, serif",
                }}
                to="/login"
              >
                Logout
              </Link>
            </Typography>
          </Toolbar>
        </AppBar>
        {/* ---------------------------------------------footer--------------------------------------------------
                                                     ----------------------------------------------------------------------------------------------------- */}

        <footer id="footer">
          <Card style={{ width: 300 }}>
            <h2 className="widget_h_3">Latest from the Blog</h2>
            <ul>
              <li>
                <a href="https://petfbi.org/moving-here-are-some-tips-to-keep-your-dog-safe/">
                  Moving? Here are Some Tips to Keep Your Dog Safe
                </a>
              </li>
              <li>
                <a href="https://petfbi.org/how-to-safely-store-household-chemicals-out-of-reach-of-your-pets-and-other-wildlife-animals/">
                  How to Safely Store Household Chemicals Out of Reach of Your
                  Pets and Other Wildlife Animals
                </a>
              </li>
              <li>
                <a href="https://petfbi.org/google-voice-scam-alert/">
                  Google Voice Scam Alert!
                </a>
              </li>
              <li>
                <a href="https://petfbi.org/the-big-give-is-back/">
                  The Big Give is Back!
                </a>
              </li>
              <li>
                <a href="https://petfbi.org/catch-me-if-you-can/">
                  Catch Me If You Can!
                </a>
              </li>
            </ul>
          </Card>
          <Card style={{ width: 300 }}>
            <h2 className="widget_h_3">Who We Are</h2>
            <p>
              Pet FBI was founded in 1998 as one of the first web-based lost and
              found pet databases. We began in Ohio and now serve the United
              States, Canada, Puerto Rico, and the Virgin Islands.
            </p>
          </Card>
          <Card style={{ width: 300 }}>
            <h2 className="widget_h_3">Donate</h2>
            <p>
              Pet FBI is a small group of dedicated volunteers and we need your
              support. If you think we are providing a useful service, please
              help us with a donation, no matter how small.
            </p>
            <a
              className="wpb_button_a"
              href="https://petfbi.org/how-to-help/donation-form/"
            >
              <span className="wpb_button wpb_wpb_button wpb_btn-large btn-success">
                Donate
              </span>
            </a>
          </Card>
          <Card style={{ width: 300 }}>
            <h2 className="widget_h_3">Other</h2>
            <a
              target="_blank"
              rel="noopener noreferrer"
              href="https://petfbi.org/how-to-help/anyone-can-help/manual-for-pet-fbi-special-agents/"
            >
              Pet Alerts Signup
            </a>
          </Card>

          <p>
            All content in this site by Pet FBI copyright (C) 1998-2020
            Registered 501(c)(3) EIN: 31-1622434
          </p>
        </footer>
      </div>
    );
  }
}

export default Navbar;
